window.bookSummaryJSON = "<p>Undercover in the French Quarter<br> <br> with only each other to trust.<br> <br> A legendary rock band’s reunion is just a ruse for FBI agent Chase McCoy’s investigation. Seven years ago, Skyhawk’s lead singer died under suspicious circumstances. Chase knows Sky Ferguson is fronting the band in her father’s honor for the same reason Chase has agreed to be the drummer. They want answers. But having to pose as a couple makes them question just how far they’ll go for the truth.<br> <br> <b>From Harlequin Intrigue: Seek thrills. Solve crimes. Justice served.</b></p>"; 
